class Routes extends Component {
  constructor(props) {
    super(props);
    this.state = {
    }
  }

  render() {
    return (
      <Switch>
        <Route exact path='/manageEmployees' component={EmployeeListPage} />
        <Route exact path='/createUser' component={CreateUser} />
        {/* <PrivateRoute {...this.props} exact path="/" component={default_page} />
        <PrivateRoute {...this.props} exact path="/manuals" component={Manualrouting} /> */}
      </Switch>
    );
  }
}

export default Routes
